(830, 1, 'admin@codzio.com', 'Blog', 'blog', NULL, 'a:8:{s:8:\"admin_id\";s:1:\"1\";s:5:\"title\";s:79:\"Your Kid’s bike gets punctured very often? Here’s why it might be happening\";s:11:\"description\";s:4143:\"<p>Isnt it hugely disappointing when a child gets all set to ride her/his bike and finds out at the last moment that one of the tyres is punctured? </p>\r\n\r\n<p>Punctures are quite frequent in cycles and one of the most common “service/repair requests” in the cycling ecosystem. </p>\r\n\r\n<p>Among seasoned cyclists, punctures are referred to as “an act of God” that will happen irrespective of all efforts that the cyclist makes to avoid it! </p>\r\n\r\n<p>The best way out of a puncture situation is to learn to fix punctures. However, one can significantly reduce the frequency of punctures by knowing how punctures usually happen and how to avoid them. </p>\r\n\r\n<p>Lets look at the main types of punctures:</p>\r\n\r\n<p>1.    Pinch puncture: A pinch is the most common type of puncture that happen in most bikes. <br>\r\nWhats a pinch: When the tube gets pinched between the rim and an external object, it results in extreme stresses at the edges of the pinch leading to a typical 2 hole  or one hole puncture at the edges of the pinch. <br>\r\nWhy do pinches happen: In most cases, because the tube is not inflated with enough/correct pressure. In such a scenario, when the wheel goes over an obstacle(like a small stone or a speed breaker), the tyre suddenly gets pinched between the external object and the rim – leading to an immediate puncture at the edges of the pinch. Usually pinch puncture holes are quite small and take a while for the tube to deflate completely.<br>\r\nHow to avoid: Quite simply, by inflating your tube to the correct pressure. Most cycle tubes are designed for 35-40bar of pressure. Ensure this while getting the tubes inflated. Alternatively, use the age old technique of squeezing the tyres before riding to check if they are hard enough with air pressure. </p>\r\n\r\n<p>2.    Punctures caused by sharp/pointed objects<br>\r\nWhen driving on open roads, it is quite common to have a steel nail or a hard thorn penetrate the tyre and puncture the tube. Punctures caused by such objects usually lead to complete deflation of tube within a few minutes, if not immediately. <br>\r\nCauses of such punctures: Objects on the road. And these cant be avoided in any scenario.<br>\r\nHow to avoid: Keep a slightly higher pressure in the tubes. This will help the tyres in resisting penetration by a sharp object. If residing in an area that typically has a lot of such objects, the following two options can be explored:<br>\r\na.    Tyre Liners: These are liners that make a layer between the tyre and the tube and help in resisting the penetration<br>\r\nb.    Slime: This is a gel like solution that is filled inside the tubes. In case of a puncture, the exiting gel quickly solidifies at that area and closes the puncture. This is the closest that you can get to a tubeless set up and prevent in-convenience of punctures.</p>\r\n\r\n<p>3.    Punctures caused by tube/tyre wear<br>\r\nIf the bike is left outside in very hot/cold weather, it leads to significant wear of the tyre and tube surfaces. Typically, a tyre would wear out within 3 years of manufacture even without any road use. <br>\r\nIn case of worn out tubes, the surface becomes porous and air gradually leaks out. These punctures wont show in normal puncture tests as the leakage is very gradual and slow. <br>\r\nWhat to do in such a case: There is no option but to replace the tubes and tyres. </p>\r\n\r\n<p>4.    Faulty valves<br>\r\nAt times, the tube structure is intact but the valves are faulty and are not able to trap air properly. Most modern kids’ bikes in India have Schrader valves(similar to those in cars and motorcycles). In many cases, the valve internals can be replaced and it will start working fine. However, in case there is a cut around the valve joint, the tube has to be replaced.</p>\r\n\r\n<p>A sure shot way of avoiding punctures is to shift to tubeless tyres. However, most kids’ bikes in India don’t come equipped with wheels/rims that will support a tubeless set up and this option is not available.</p>\r\n\r\n<p>Do read our other blogs on ways to keep your tyres healthy and how to repair a puncture at home! <br>\r\n </p>\";s:4:\"date\";s:10:\"2021-07-08\";s:4:\"link\";s:40:\"Your_Kids_bike_gets_punctured_very_often\";s:11:\"author_name\";s:12:\"Beetle Bikes\";s:13:\"display_order\";s:0:\"\";s:5:\"image\";s:47:\"uploads/blog/buy-tubes-for-cycling-in-india.jpg\";}', 'Insert', '2021-10-27 08:45:25'),
(831, 1, 'admin@codzio.com', 'Blog', 'blog', NULL, 'a:8:{s:8:\"admin_id\";s:1:\"1\";s:5:\"title\";s:57:\"How to keep your child’s bike running in good condition\";s:11:\"description\";s:3813:\"<p>We come across a lot of cases where a child is unable to ride her/his bike due to multiple small and nagging issues in the bike that keep occurring from time to time. Most of these issues are quite small and do not warrant the entire effort of visiting a bike service shop – however, due to these issues, the child does not find cycling comfortable or enjoyable.</p>\r\n\r\n<p>We are listing a few simple things that can be done by you or the child at home that will ensure that these issues don’t kill the pleasure of riding a bike.</p>\r\n\r\n<p><strong>1.    Bike Cleaning:</strong><br>\r\nJust this one act will take care of 90% of your problems! Take it from us, we clean our bikes ourselves at home! <br>\r\nWhen a bike is not cleaned regularly, it leads to accumulation of dirt, oil and other unsavory stuff at all the wrong places – drive train, brakes, bearings et al. With just a simple wash, you can ensure that your kids’ bike will need to go to the service centre far less frequently!</p>\r\n\r\n<p>All you need to clean your child’s bike is a bucket of soap water, some old rags and a used toothbrush and some normal water for rinsing. </p>\r\n\r\n<p>The frame, tyres, saddle and handlebar area just need soap water cleaning followed by rinsing. The chain, crank & rear freewheel will need a bit of brushing with concentrated soap water.  </p>\r\n\r\n<p>Cleaning can be cone once every 7-10 days or depending upon storage/usage conditions. In general, if you can see a thin layer of dust on the bike, it needs cleaning! </p>\r\n\r\n<p><strong>2.    Bike storage</strong><br>\r\nBikes very often don’t get the love that they deserve! They usually get stored in the common parking areas, or in balconies and are usually exposed to the sun and elements. Dust, sun, rain and general exposure to the elements leads to a lot of wear and tear of parts. <br>\r\nThe parts that get most damaged with such storage are:<br>\r\nDrive train: Dust accumulates on the chain/crank/freewheel as these are lubricated parts. Dust sticks to the oil on these parts. When the cycle is used, dust will lead to significant wear and tear due to increased friction.<br>\r\nSaddle, Grips: These get completely damaged in the sun and would need replacement much earlier than normally required. <br>\r\nTyre/Tube: Most prominent impact of the sun is on tyres and tubes. Natural elements lead to significant erosion of tyre and tubes even without normal use of the bike. </p>\r\n\r\n<p>It is best to store your child’s bike in shade. If this is not possible, cover it with a thick piece of cloth or cover. A cover is definitely needed if the storage area has exposure to dust. </p>\r\n\r\n<p><strong>3.    Oiling/Lubrication</strong><br>\r\nLubrication of moving parts will lead to slower deterioration of parts due to wear and tear. Principally there is only the transmission that needs periodic lubrication as it is exposed. Ideally you need a specific chain lubricant for this purpose, however, you can also work with light machine oil.</p>\r\n\r\n<p>Do clean the chain with soap water solution before lubricating it again. </p>\r\n\r\n<p><strong>4.    Taking care of tyres/tubes </strong><br>\r\nTyres & Tubes are the most common reasons for inability to use the bike. Punctures or loss of air pressure will render the bike unusable till the problem is resolved.</p>\r\n\r\n<p>While the best case is to learn to how to fix a puncture(read our other blogs on this), you can also try to avoid punctures as much as possible by doing two simple things: a. Keep the pressure in the tubes at the recommended level and not below it. And b. As far as possible, avoid storing the bike in direct sunlight. This causes excessive and rapid wear of tyres leading to frequent punctures</p>\r\n\r\n<p>Do read our other blogs on how to repair your kids’ bikes! </p>\";s:4:\"date\";s:10:\"2021-10-06\";s:4:\"link\";s:54:\"How_to_keep_your_childs_bike_running_in_good_condition\";s:11:\"author_name\";s:12:\"Beetle Bikes\";s:13:\"display_order\";s:0:\"\";s:5:\"image\";s:48:\"uploads/blog/your-cycle-maintenance-tool-box.jpg\";}', 'Insert', '2021-10-27 08:47:35'),
