(984, 1, 'admin@codzio.com', 'Product', 'product', NULL, 'a:31:{s:8:\"admin_id\";s:1:\"1\";s:12:\"product_name\";s:36:\"Wheely Zest, 26T, 6 speed Adult Bike\";s:4:\"slug\";s:34:\"wheely-zest-26t-6-speed-adult-bike\";s:10:\"break_type\";s:0:\"\";s:11:\"handle_type\";s:0:\"\";s:9:\"tyre_type\";s:0:\"\";s:14:\"frame_material\";s:0:\"\";s:10:\"frame_size\";s:0:\"\";s:10:\"wheel_size\";s:0:\"\";s:16:\"category_level_1\";s:1:\"1\";s:16:\"category_level_2\";s:0:\"\";s:11:\"description\";s:1457:\"<ul>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">The cycle is delivered in Semi-Assembled condition (85% assembled). Customer needs to assemble it before use. Allen Key & Spanner provided in box for installation.</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Wheel size: 26 inches | Tyres: Black | Rim: Steel grey</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Ideal For: 15+ Years | Unisex | Min Rider Height: 4 feet 10 inches| Max Rider Height:  5 feet  8 inches</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Front Brake: V-Brakes | Rear Brake: V-Brakes</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Gears: 6 Speed | Rear Derailleur: Shimano | Rear Shifters: Shimano Revo shift | Front Shifter : NA | Front Derailleur - NA</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Frame Material: Steel | Suspension: NA | Side Stand: Included</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">In Box Content: Allen Key & Spanner: Yes| Stand: Yes| Carrier: No| Front Reflectors/Rear Reflectors : Yes| Chain Cover: Yes| Mudguards: Front & Rear, Steel</span></span></span></li>\r\n</ul>\";s:14:\"specifications\";s:3293:\"<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Introducing the Wheely Series from Beetle Bikes! Wheely Bikes are created with the same passion and love that go into Beetle Bikes and now offer not just kids’ bikes but also adult bikes in 26T – 29T sizes, as well as e-bikes! </span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">In the Wheely series, Introducing <strong>Wheely Zest</strong>, a Bike that perfectly mixes style and substance!</span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">This durable and dependable bike is engineered from strong and lightweight steel and is equipped with superb components to ensure every cycling venture is efficient and comfortable. </span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">The Wheely Zest is loaded with style. The Turquoise – Mustard dual coloured frame will make the rider stand out from the crowd! The mudguards are coordinated with the frame colour shades giving the Zest absolutely stunning looks. Steel grey coloured wheels further add to the overall looks of the bike. </span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">With high end components, the Beetle Black will ensure a safe and smooth ride for you. Armed with Shimano 6-speed derailleur in the rear, you can easily capture uphills as well as flat surfaces with ease. An adjustable saddle post allows the bike size to be set as per your height to ensure maximum comfort and power delivery. </span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">With high quality MIG welding on the frame, you can be sure that this bike will take all obstacles in its stride. The smoothness is further made better with 2.1 inch tyres. </span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Saddle height is adjustable and can be raised or lowered as per the rider height. High quality, slip resistant pedals ensure that the rider enjoys cycling in a safe manner.</span></span></p>\r\n\r\n<p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Adopt the new definition of urban styling with Wheely Bikes! </span></span></p>\r\n\r\n<p xss=\"removed\"><strong><span xss=\"removed\"><span xss=\"removed\">Highlights:</span></span></strong></p>\r\n\r\n<ul>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Strong & lightweight Steel Frame</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Bold design that stands out from the crowd</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Adjustable Seat height</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">High quality Transmission</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Durability & Stability with a well designed frame stance</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Built to last. Unlimited time warranty on frame</span></span></span></li>\r\n <li xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"><span lang=\"EN-US\">Huge on Style!</span></span></span></li>\r\n</ul>\";s:8:\"sku_code\";s:15:\"FG-YBK26BLTRA01\";s:8:\"hsn_code\";s:8:\"87120010\";s:9:\"dimension\";s:7:\"15+ yrs\";s:10:\"net_weight\";s:6:\"15.000\";s:5:\"stock\";s:3:\"100\";s:3:\"mrp\";s:8:\"17999.00\";s:13:\"selling_price\";s:8:\"10999.00\";s:3:\"gst\";s:2:\"12\";s:14:\"available_date\";s:10:\"2022-03-06\";s:14:\"available_time\";N;s:10:\"image_path\";s:30:\"uploads/product/main-image.png\";s:8:\"featured\";i:0;s:15:\"display_on_home\";i:0;s:13:\"display_order\";s:1:\"1\";s:5:\"label\";s:15:\"Wheely Zest 26T\";s:10:\"meta_title\";s:11:\"Wheely Zest\";s:14:\"meta_key_words\";s:30:\"Wheely Bikes, Adult Bikes, 26T\";s:16:\"meta_description\";s:0:\"\";}', 'Insert', '2022-03-07 07:50:44'),
