INSERT INTO `blogs` (`id`, `admin_id`, `title`, `description`, `date`, `link`, `author_name`, `image`, `is_active`, `display_order`, `created_at`, `updated_at`) VALUES
(4, 1, 'Tips for carrying your kids\' bike in your car', '<p>Cycling is a great way to unwind for people of all ages. Its growing popularity is seeing a greater number of adventure enthusiasts take off to new, uncharted territories on their bikes. And being able to carry your bicycle in your car opens up an even wider range of possibilities. But since cars are not designed to carry bicycles, it can be a difficult task to load your bicycle onto your car. In this article, we will look at some ways to do so and explore their pros and cons.</p>\r\n\r\n<p><strong>Carrying the bike inside your car</strong><br>\r\nThis method is the safest since your bicycle is not exposed to bad weather and thieves. If your car is spacious enough, your bike may fit inside the boot, although sometimes you may have to fold the rear seats of the car or remove the front wheel of your bike. If your car is compact, you may have to disassemble the wheels, the pedals and the handlebar in order to fit your bike.<br>\r\nHowever, this method is inefficient due to the time it takes taking bicycle parts away and assembling them. Your bike is also likely to dirty the interior of your car, apart from reducing the seating space. But if you’re looking for a cheap solution and fast loading is not your priority, then this may be the answer for you.</p>\r\n\r\n<p><strong>Carrying</strong> <strong>the</strong> <strong>bike on a rear-mounted rack</strong><br>\r\nMost cycling enthusiasts prefer using rear-mounted bicycle racks, since they are easy to use, even though they increase the effective width of the car. However, do note that most racks are designed for adult cycles and may not work for cycles below 20inch in size.</p>\r\n\r\n<p>There are two kinds of rear racks available in the market: a boot rack and a tow-mounted rack.<br>\r\n1) Boot-mounted Rack<br>\r\nIt is the most inexpensive way to carry your bicycle on your car, even though the fixture may feel wobbly at times. The rack is strapped onto the boot lid of the car, and the bike is held by a pair of arms on the rack. Loading is fast and easy although the paintwork of the car and the bike can be damaged if not secured properly. This rack is easy to fit and to remove. The drawbacks are that it restricts access to the boot, hides the number plates and car lights, and leaves the bicycle exposed to natural elements as well as thieves. Also, a rack is usually specific to a particular car model.<br>\r\n2) Tow-mounted Rack<br>\r\nIt is one of the most convenient bicycle accessories used by cyclists worldwide. A tow-mounted rack provides a secure attachment to your car. Owing to its foldable design, it easily swings out of the way when you have to use the boot even with the bike attached. Its solid assembly does complete justice to its comparatively higher price and it can easily carry up to five bikes. The only potential issue could be that a tow bar is necessary, and not every car has one. You also need to ensure that the load on the tow bar is not more than that specified by your car manufacturer.</p>\r\n\r\n<p><strong>Carrying your bike on your car’s roof</strong><br>\r\nWhile travelling with your bicycle, you can also mount it on your car’s roof. A bicycle rack, designed specifically for this purpose, is clamped onto the roof rails of the car. Since you can buy the racks depending on how many you need (and can fit on your roof), up to four bikes can be easily carried. Your bike can either be mounted upright or upside down, depending on the kind of bicycle rack you’re using. However, some racks may require you to dismantle the front wheel. This creates an additional problem of storing the front wheel separately.<br>\r\nWith your bike mounted on the roof, you also need to be conscious of driving through places with restricted heights and low hanging tree branches. Driving in windy conditions becomes risky and your fuel consumption is also affected, since this method is not aerodynamically efficient. If your bike is heavy, lifting it up to the roof can also be difficult at times.</p>\r\n\r\n<p>Still, investing in roof-mounted carriers is a good decision since it is reasonably priced, and you can easily find a rack that suits the model of your car. Moreover, your access to the boot is no longer limited and you don’t have to give up on seating space. There are no obstructions in the rearview mirror or the car lights. The number plate is also not hidden behind the rack. Neither your car nor your cycle’s paintwork is damaged.<br>\r\nIn the end, choosing the method comes down to your needs and what will suit you best.</p>', '2020-06-01', 'Tips_for_carrying_your_kids_bike_in_your_car', 'Beetle Bikes', 'uploads/blog/tips-while-buying-bicycles-for-kids.jpg', 1, 0, '2021-10-27 08:21:32', NULL),
(5, 1, 'Tips for buying a cycle online', '<p>Cycling is, by far, the only transport method that not only gets you places but also helps maintain physical fitness. Selecting the right bike that is suitable not only for your child’s physique but also their daily requirements can prove to be tricky. Clearly, a lot goes into making a decision when searching for <strong>bicycles for kids</strong>.</p>\r\n\r\n<p>What must one look for when purchasing a bicycle for their child? To start with, height and size are important criteria when buying <strong>bicycles for kids</strong>. Here are some tips to give a head start when purchasing a bicycle for your child.</p>\r\n\r\n<p><strong>Size</strong></p>\r\n\r\n<p>While choosing the perfect bicycle size for your child, it is essential you consider their height, weight and build. It is also important you don’t choose a much bigger size thinking your child will “grow into it”. This is a wrong notion that doesn’t take into account the fact that the bigger the size, the greater its weight and the more is the effort involved in manoeuvring it. The best way to make this decision is to make your child stand comfortably over the <strong>bicycle seat</strong> and see if their feet reach the <strong>bicycle pedals</strong> with ease, or make them stand over the bicycle with feet flat on the ground. Remember that <strong>bicycles for kids</strong> are not determined by the <strong>bicycle frame</strong> itself but by the size of the <strong>bicycle tires</strong>. Depending on your child’s ability and confidence, you can attach side support wheels when they are still picking cycling up and remove them when required.</p>\r\n\r\n<p><strong>Bicycle Brakes</strong></p>\r\n\r\n<p><strong>Bicycle brakes</strong> are usually of two types - coaster and lever-operated brakes. A coaster is a type of <strong>bicycle brake</strong> activated by pedalling reverse and usually features in bikes for young children that lack arm strength to operate a hand lever. On the other hand, lever-operated brakes are more of an inculcation of good cycling habits as opposed to a practical use. Usually found in balance bikes, this brake is added with coaster brakes for children of 2-5 years of age since they lack physical strength. Depending upon your child’s capability, strength and confidence you can buy a cycle with hand brakes.</p>\r\n\r\n<p><strong>Bicycle Seat</strong></p>\r\n\r\n<p>An appropriate <strong>bicycle seat</strong> height is an important consideration when making a purchase. Check the minimum and maximum height along with the standover height. Seat height for kids start from 25cm and goes up to 100 cm for adults. Another good practice is to ensure the <strong>bicycle seat</strong>’s height is adjustable. This way, your child can use it even when their height rapidly increases during their growing years.</p>\r\n\r\n<p><strong>Safety Tips</strong></p>\r\n\r\n<p>It is also important to follow basic safety tips when cycling with your child. Ensure your child&#39;s bike fits and meets adequate quality standards. If you’re cycling with your child, take up a position behind them to ensure they remain safe from harm. And don’t forget to make the responsible choice of carrying a helmet for your young one.</p>\r\n\r\n<p>At the end of the day, choosing a bicycle your child is comfortable with is the ultimate goal of this search. Visit Beetle Bikes to browse through a cool set of kids&#39; bikes today!</p>', '2020-07-01', 'Tips_for_buying_a_cycle_online', 'Beetle Bikes', 'uploads/blog/buy-cycles-for-boys-and-girls-online-at-best-prices-in-india.jpg', 1, 0, '2021-10-27 08:23:25', NULL),
(6, 1, 'Why Cycling is good for Kids', '<p>Nearly everyone we know, be it an adult or child, has a cherished memory of the first day they learned to ride a bicycle, their own version of moments spent on the <strong>bicycle seat</strong>. The joy of cycling with friends, pretending to be explorers or warriors, was a formative experience for many. So many of us associate our childhood with the joy of cycling.</p>\r\n\r\n<p>In this fast-paced world, cycling is more important than ever, especially for kids. It creates a fun escape away from school, tuitions, and grades. Especially in an era of video games & mobile phones, cycling offers a great way for kids to get some fresh air and exercise. Clearly, cycling is an activity best picked up young. So, get your kids off their gadgets and gift them the joy of cycling. Here’s how cycling benefits your child in the long run.</p>\r\n\r\n<p><strong>Boosts Academic Performance</strong></p>\r\n\r\n<p>Several studies link cycling regularly to an improvement in grades. Children cycling regularly display greater alertness and responsiveness than their peers in class. The physical exercise and social interaction with other kids of their age group naturally have a refreshing effect on the child’s mind. This gives them a clean slate for the absorption of new information in the classroom. Cycling is the perfect activity to engage your child in, both before and after school.</p>\r\n\r\n<p><strong>Health Benefits</strong></p>\r\n\r\n<p>Just like any other exercise, cycling is an efficient stress-buster. Not only does it elevate the child’s mood but also has a positive effect on their health. A low-impact exercise, cycling is a good way to exercise the body without experiencing fatigue. It builds your child’s stamina and a strong core, keeping them fit. Furthermore, spending time outdoors riding a bicycle has been known to reduce depression and anxiety attacks, while improving mood. Thus, cycling is good for both the physical and mental health of your child.</p>\r\n\r\n<p><strong>Natural Entertainment</strong></p>\r\n\r\n<p>Video games, TV-on-demand, and the internet may seem entertaining prospects to your kid but they are known to adversely affect development. Riding downhill with nothing but gravity guiding you, finding new trails to places unknown and making memories with family and friends is what makes cycling a naturally entertaining activity. It’s the simple things in life that prove to be the most rewarding. Once your kid learns to ride a bike, it becomes a way for them to have fun daily with friends and family for life.</p>\r\n\r\n<p><strong>It’s Good for the Planet</strong></p>\r\n\r\n<p>Teaching your child to cycle has long-term benefits for the environment – it reduces carbon emissions, eases traffic congestion, and makes our communities greener and healthier. Petrol shortages will soon force millions to use fuel-friendly ways to travel. And a good habit formed during childhood is sure to carry over in the future. Encourage your kid to cycle short distances to cut down their dependence on motor vehicles .</p>\r\n\r\n<p>Cycling is a great habit to cultivate in your child. Not only does it have health benefits to offer, but it is also good for our environment, which is a lesson kids must learn early on in life. It is also how they learn other valuable lessons – how falls and accidents are a part of life but picking yourself up and continuing to pedal is what counts. To choose a bicycle and bicycle accessories for your kid, choose from a range of options at Beetle Cycles today. After all, the greatest investment you can make is in your child’s future.</p>', '2020-08-01', 'Why_Cycling_is_good_for_Kids', 'Beetle Bikes', 'uploads/blog/this-children’s-day-gift-your-kid-a-cycle-for-better-health.jpg', 1, 0, '2021-10-27 08:24:34', NULL),
(7, 1, 'Common mistakes made while buying a kids bike', '<p>Buying a bike for your child is an exciting activity. You are introducing your child to the joy of cycling. She/he will soon be able to enjoy the wind in their hair while enjoying the feeling of joyousness that comes with cycling.</p>\r\n\r\n<p>But very often we come across situations where kids start disliking cycling after getting their first cycle.</p>\r\n\r\n<p>What happened? In most cases, the parents got a wrong cycle for their child. The cycle is too difficult to ride, or just too ugly – leading the child to just drop the idea of cycling.</p>\r\n\r\n<p>How to avoid common mistakes that many parents make while buying their child a cycle. Read on:</p>\r\n\r\n<p><strong>1. Weight of the bike:</strong> This is by far the single biggest reason for a child to hate cycling. While most adults are very particular about the weight of the bike when buying for themselves, they end up buying a very heavy cycle for their child.</p>\r\n\r\n<p>In many cases, we have seen a 35kg child riding a 20 kg bike! Imagine the amount of extra energy consumed by the weight!</p>\r\n\r\n<p>Always ensure that you buy a cycle that is as light as possible. Do not get fooled by existing large brands in India – most have very heavy cycles.</p>\r\n\r\n<p>When at a shop, just pick up the cycles on display to compare their weight. When buying online, you can ask the question to the seller – or check if its mentioned in the description. Usually any bike over 13-14kg is unsuitable for a child.</p>\r\n\r\n<p><strong>2. Design/Looks of the Bike:</strong> A common problem with brands available in India is the looks or design of the bike. In a bid to stand out from the crowd, many of India’s top brands have ended up with garish looking cycles for kids. Most cycles have every combination of yellow/green/red and any other colour that can be added to the bike. On top of that, there are excessive decals on the entire frame making the bike look like a moving doodle.</p>\r\n\r\n<p>Would you get yourself a multi-colour car with loud graphics all over? Then why expect your child to ride something like that?</p>\r\n\r\n<p>Get a bike that looks good and something that your child will feel proud while riding on the road.</p>\r\n\r\n<p><strong>3. Size of the Bike:</strong> Many parents tend to take a size larger than what the current age/height of the child would demand. The logic often given is that the child would out-grow the cycle and a new one would have to be bought in a couple of years. In the process, parents inadvertently hand over an over-sized bike to their kids. The bikes are difficult to manage, uncomfortable to ride and prone to fall as the child is uncomfortable on it.</p>\r\n\r\n<p>Always take the size that’s correct for the child TODAY. Not in the future.</p>\r\n\r\n<p>Or take a bike that has easily adjustable seat height and handlebar angles. That would ensure that your bike grows with the child.</p>\r\n\r\n<p>But most importantly, if the child does outgrow the bike – be proud of the fact, and just get them a new bike. Do not compromise on their comfort for a small amount of money spent every 2-3 years.</p>\r\n\r\n<p><strong>4. Chinese Bikes:</strong> Another issue that we see is the purchase of Chinese/Un-branded bikes just to save a few hundred rupees. Do note that most of these bikes come without any quality certification. Not only is the frame/crank etc prone to breakage, there are other elements that need to be considered too. In the Indian summers, the handlebar grips on these cheap cycles tend to lose their paint adhesiveness. This paint automatically gets transferred to your child’s hands – and from their, into their mouths. Lead based paints are a serious health risk and needs to be avoided at any cost!</p>\r\n\r\n<p>Beetle Bikes offer high quality and size adjustable bikes for Kids. Beetle makes bikes ONLY for kids and knows what they need very well. As a result, we are able to bring out bikes that Kids, and their parents, love all over the country.</p>', '2020-11-12', 'Common_mistakes_made_while_buying_a_kids_bike', 'Beetle Bikes', 'uploads/blog/buy-cycles-for-boys-and-girls-online-at-best-prices-in-india_1.jpg', 1, 0, '2021-10-27 08:27:05', NULL),
(8, 1, 'Buy Cycles for Boys and Girls Online at Best Prices in India', '<p>Remember the immense thrill of riding your first bicycle? Such memories are simply unforgettable and wash us over with it a feeling of freedom and happiness. Young impressionable minds embarking on an adventure and forming unbreakable friendships is the true essence of riding a bicycle. From the first time you sat atop a <strong>bicycle seat</strong> to the first time you finally mastered riding one, each event went down in memory as a victory.</p>\r\n\r\n<p>So it is only fair your child gets to experience the same joy you found in riding a bicycle. Besides helping them stay fit, it is a fun activity to undertake. Kids can easily ride a bicycle after they turn three years old. But children never stay the same size for long, which makes the job of finding the right bicycle all the more important. It might seem like a tedious task but we are here to guide you through this ordeal.</p>\r\n\r\n<p><strong>Know What You Want</strong></p>\r\n\r\n<p>Since your child will be riding the cycle frequently, involve them in the purchase decision. It is essential to keep your child be comfortable and confident in the bike they choose. Understand their desires and what they look for in their first cycle. And unlike in the past, you have endless options to choose from today. So make a well-informed decision by asking your child which colour and type of bicycle they want. From a pink princess bike for your daughter to a black superhero bike for your son, you can get as creative as you’d like.</p>\r\n\r\n<p><strong>Size Issues</strong></p>\r\n\r\n<p>When it comes to kids, you usually rely on the diameter of the <strong>bicycle wheel</strong> as a reference point, as opposed to looking at the <strong>bicycle frame</strong> for adults. Wheels sizes typically come in 12, 16 and 20 inches to give your child a wide variety. While size 12-inch <strong>cycle wheels</strong> are designed for young kids that are still learning how to ride a cycle, bigger sizes are for older kids. Use a sizing chart as a reference when trying to find the perfect cycle. Measuring your child’s height and doing some research should be enough to give you an idea of what would be the best fit for your child.</p>\r\n\r\n<p><strong>Height Charts Are Not a Definite</strong></p>\r\n\r\n<p>Height charts should definitely not be an end game or a tiebreaker in your pursuit of buying a good cycle for your boy or girl. It is essential you come to realize that they are just the initial prerequisites. To see how comfortable your child will be with a particular bicycle, ask them to give the bicycle a quick spin. A test ride can reveal a lot about the comfort of the <strong>cycle seat</strong>, engaging <strong>bicycle brakes</strong>, the strength in the <strong>bicycle frame</strong> and how comfortable and in control your child is with the bicycle.</p>\r\n\r\n<p>Buying a cycle for your young ones can be quite a task, especially for the uninitiated. After all, the kids come with their unique needs which must be taken care of. Because cycling serves as an excellent physical exercise for your child, encourage them to engage in it by buying them an amazing bicycle. A cycle that is too big or too small is uncomfortable and difficult to ride. This could lead the child to reject the sport, forgoing the benefits that can be achieved from the exercise.</p>\r\n\r\n<p>Buying a cycle online is an easy way to go through all the possible options to find the right match. Visit Beetle Bikes for a cool selection of children’s bicycle available online. And do not forget other important cycling accessories like <strong>bicycle helmets</strong> and gloves to keep your young cyclist safe from crashes.</p>', '2021-01-01', 'Buy_Cycles_for_Boys_and_Girls_Online_at_Best_Prices_in_India', 'Beetle Bikes', 'uploads/blog/buying-guide-for-a-used-cycle.jpg', 1, 0, '2021-10-27 08:28:37', NULL),
(9, 1, 'Buying a cycle for girls', '<p>What can be a better way to exude girl power than to ride around on your very own cycle! The feeling of ecstasy that comes with zooming around your neighborhood on your cycle is truly priceless! But only the right bicycle as per your body structure and frame can make you genuinely happy. The perfect bicycle for kids can vary as per sex. Thus, whether you are a first-time cyclist or a pro on two wheels, here’s a guide about things to keep in mind while buying a cycle for a girl.</p>\r\n\r\n<p><strong>First Things First</strong><br>\r\nMeasure your overall height and body dimensions. You should be aware of these numbers while shopping for cycles at the store. You can save time by telling these details to the store attendant, who will then point you towards the most appropriate models. As compared to boys, girls are likely to have longer legs but shorter arms. Thus, a perfect cycle for you would be one on which you feel completely in control. Wear your cycling shoes to the bicycle shop so that you can simulate cycling. Get off and onto the bicycle a few times to get the hang of it.</p>\r\n\r\n<p><strong>What’s Next?</strong><br>\r\nMake sure you have the correct posture while riding the bicycle. You should feel relaxed but alert on the cycle. No part of your body should be scrunched up to fit the frame. Cycle a few times in the store or around the block to be very sure that the choice you made is perfect for you. Try out as many models as possible before arriving at a final decision. Practice braking suddenly to test the brake strength. Test the bicycle handlebars for a comfortable grip and check if it turns easily without much exertion.</p>\r\n\r\n<p><br>\r\nDetermine the comfort level of the bicycle seat. If the seat is not comfortable enough, ask if alternatives are available, or if it can be changed. Most manufacturers offer a variety of options and thus, you should be easily able to find your perfect bicycle. Be sure to look up general age guidelines to select a suitable cycle size. For pre-teens, sixteen to twenty inches frames are recommended, while for teenagers and adults, the cycle frame may extend beyond twenty-four inches.</p>\r\n\r\n<p><strong>Gear Up</strong><br>\r\nIf you are still learning how to ride a bicycle, consider investing in training wheels. Ask the store attendant to attach these wheels to your selected model so that you can try out their performance and check how comfortable you are while riding. And of course, a sturdy standardized bicycle helmet is a must while cycling to prevent all types of head injuries. Also, invest in elbow and knee pads to avoid scrapes and cuts while learning how to ride your cycle.</p>\r\n\r\n<p><strong>Girls Cycle Versus Boys Cycle</strong><br>\r\nThe most common distinguishing factor between girls bicycle and boys bicycle is the presence or absence of a metal bar which is used to connect the bicycle saddle to the handlebars. This is usually present in cycles built for boys. However, there are other factors too that need to be considered:</p>\r\n\r\n<p><strong>The Shape of the Saddle</strong><br>\r\nFor boys’ cycles, the saddle tends to be narrower and longer than in girls&#39; cycles. It is generally the opposite for girls’ as the design complements the size of the female pelvis which tends to be wider. So, consider the shape and design of the bicycle saddle before you select a model.</p>\r\n\r\n<p><strong>Frame Design</strong><br>\r\nThe first cycles for women were built with step-through frames, to make it easier for women wearing dresses and long skirts to climb onto it. This initial design has carried on to this day, and women’s cycles still do not have a metal bar connecting the saddle and handlebars. This makes the frame weaker compared to men’s cycles, but not significantly so. This step-through design makes it easy to mount and dismount for females.</p>\r\n\r\n<p><br>\r\n<strong>Frame Size</strong><br>\r\nGirls bicycles are manufactured keeping in mind the physiological differences between the male and female anatomy. Female cyclists now enjoy cycles with slightly smaller bicycle tyres, brake levers, and grips. Also, the handlebar width is narrower to accommodate female shoulder width and the entire structure supports girl’s shorter torsos and longer legs compared to boys.</p>\r\n\r\n<p><strong>Customization</strong><br>\r\nBoys&#39; cycles are typically designed to look macho, and so come in dark colors and emphasize on speed and power while handlebar streamers and baskets, as well as bright pastel colors, are usually seen in girls’ cycles.</p>\r\n\r\n<p>Cycling is a great way to relax and is also a fun way to exercise. Buying a cycle is a long-term investment and thus, you should finalize on a model only after considering all options. A reputed and experienced brand such as <strong>Beetle</strong> can help you select a model which can serve you best!</p>', '2021-04-02', 'Buying_a_cycle_for_girls', 'Beetle Bikes', 'uploads/blog/buying-a-cycle-for-girls.jpg', 1, 0, '2021-10-27 08:30:15', NULL),
(10, 1, 'Absolute Essential Accessories for Kids\' Cycles', '<p>We all have a fond memory from childhood – riding a bicycle with friends, laughing and joking all the way. After all, they were our first real possessions as kids. It was a joyful feeling to clean, maintain, repair, and ride our very own vehicle. Of course, you want your kids to experience that marvellous feeling as well. So you buy your child a bicycle and set them off to explore this beautiful world on their own. But is that it?<br>\r\nThe parent in you wants the best for their kid. The last thing you want is your child getting into trouble while cycling. That’s where bicycle accessories come in, which allow your kids to cycle while remaining safe from harm. Here are some essentials which you must consider getting for your kids’ bicycles.</p>\r\n\r\n<p><strong>Helmets</strong><br>\r\nYour kid’s safety should be your priority and the first step to safety while cycling is wearing a helmet. It is always better to buy a bicycle helmet than a regular one as they are lightweight and have aerodynamic features. Bicycle helmets are padded and are made from a strong material that protects the child’s head from impacts. They also fit kids better than other kinds of helmets making them more secure.</p>\r\n\r\n<p><strong>Lights</strong><br>\r\nBicycle headlight is a very important accessory, especially for kids. Indian roads are full of unpredictable hurdles and it is dangerous to navigate through the roads and its potholes at night. Thus, good quality headlight is a must for your kids’ bicycle so that they can spot any problem and that they are visible to drivers.</p>\r\n\r\n<p><strong>Lock</strong><br>\r\nKids can’t always be restricted and they shouldn’t be if they aren’t up to anything mischievous. A bicycle lock becomes essential for kid’s bicycle as they leave their cycle unattended, in random places, to meet their friends or buy things from the market. It is therefore recommended to invest in a good quality lock so that the cycle is not lost or stolen.</p>\r\n\r\n<p><strong>Bell</strong><br>\r\nLike a horn works as a voice for motor vehicles, the bell is a bicycle’s voice on the road. And it is important to have a bicycle bell as it is the only form of communicating with pedestrians and other drivers. Having a good bell can prevent many potential mishaps on the road so it is important to choose a good and audible one.</p>\r\n\r\n<p><strong>Safety Wear</strong><br>\r\nSince your first priority is your kid’s safety, a helmet is not enough to cover all safety needs. There is a lot of safety equipment and accessories available that can be used, such as knee and elbow pads, which can protect your children from scratches and bruises if they happen to fall from their cycles. Special cycling pants and jockeys can prevent hamstring and leg muscle injuries while bicycle goggles protect the eyes of your kids from dust and pollution.</p>\r\n\r\n<p><strong>Air Pump</strong><br>\r\nPunctures are a common occurrence in bicycles, especially if any investment hasn’t been made in better-than-stock-quality tyres. A puncture kit may not be an ideal tool for your kids if they happen to come across this situation, but a compact bicycle pump will allow you them to fill in the air so that at least they can reach back home. A pump would also come in handy to inflate the tyres at home itself without having to go through the hassle of visiting the local shop every time.</p>\r\n\r\n<p><strong>Water Bottle</strong><br>\r\nYou don’t want your children to get exhausted while cycling and kids often exert themselves too much and become thirsty, which is unhealthy. You can avoid this situation by buying a water bottle holder for your kids’ bicycle and getting a good bottle for them. This way you can also ensure they don’t drink unclean water and upset their stomachs.</p>\r\n\r\n<p><strong>GPS Systems</strong><br>\r\nA GPS Tracking System can be fitted onto a bicycle for kids with relative ease. The machine is usually quite small and can be connected to a smartphone app. The system uses GPS signals to transmit its current location to the smartphone so you can always know where your kids are. Advance systems also send out a distress signal in case of an accident. You can also opt for Navigation systems with a screen which will help your kids in finding their way along with the tracking feature</p>\r\n\r\n<p>Kids will go out and cycle, no matter the safety. But as parents you know that their safety is your top priority. Let your children enjoy the activity of cycling and create their own memorable experiences. With these essential accessories, you can be assured of your kids’ well-being and safety while they are out there creating their memories. Visit Beetle Bikes, one of India’s fastest growing kids&#39; cycle brand, to buy these essential accessories and much more.</p>', '2021-06-01', 'Absolute_Essential_Accessories_for_Kids_Cycles', 'Beetle Bikes', 'uploads/blog/buy-bicycles-helmets-online-at-best-prices-in-india.jpg', 1, 0, '2021-10-27 08:32:52', NULL),
(11, 1, 'Hydration & Nutrition for cycling in summers', '<p>The summer is finally here. It’s time for long outdoor trips comprising of hiking, camping and of course, bicycling. However, cycling in the hot weather comes with a ton of setbacks and injuries. Bright sunny days are always a blessing, minus the dehydration.<br>\r\nTo pursue all of your cycling goals this summer season, you need to stay fit and stay hydrated at all times. Working out in the summers is especially difficult if you’re not habituated to the heat and humidity. To keep you ahead in your game, below is a brief guideline to stay hydrated and well-nourished.</p>\r\n\r\n<p><strong>Hydration</strong><br>\r\nThe most important aspect of any summer routine is to stay hydrated at all times. The hot and dry winds which blow throughout the summers are a danger to everyone. These loos quickly evaporate our sweat right after it gets formed. Since bicyclists do not sweat enough on rides, they think their body fluids are still intact. Slowly, their body starts dehydrating and severe heat injuries follow.</p>\r\n\r\n<p>Keeping yourself hydrated is a bit more than drinking water at regular intervals. Cyclists first need to evaluate how their bodies react to rapid weather changes. However, keeping some basic points in mind can keep you safe at all times.<br>\r\n1. Adaptation: Riding in the heat without adapting to it beforehand can pose severe circumstances. Hot-weather riding is not everyone’s game. Riders who are new to such a situation get exhausted quickly. There is also the potential for injuries. We need to slowly adjust our body to the heat. Riding early in the mornings or late in the afternoons is beneficial. The sun is low during these times, keeping temperatures significantly cooler. This also allows you to get slowly adjusted to the heat.<br>\r\n2. Protection: Sunburns are very closely related to dehydration. They not only fry your skin but also increase your core metabolism. This boosts fluid usage, causing quick dehydration. You need to prevent sunburns at all costs. Mask your face, hands and feet with a good sunscreen. Wear a helmet to protect your head from the heat. The helmet creates a shadow for your forehead to rest under.<br>\r\n3. Ice-packs: The heat can eventually turn your drink into the hot liquid. You need water sippers half-filled and frozen. This will keep your bike water bottle cool for longer rides. Drinking cooled water or an energy drink keeps your temperature down and workability up.<br>\r\n4. Cooling Down: Always have a damp towel with you. This comes with your cycle accessories. Keep ice packs ready and wet them with it whenever the heat rises. Apply this damp cloth to your neck and shoulders. This will lower your core temperature. Do not drop ice-cubes directly onto your skin. They constrict blood vessels.<br>\r\n5. Recover: Don’t overdo your workouts in the heat. Always take time to recover. Your normal riding routines burn more calories and increase greater core temperature in the summer heat. Slow down at times to take a breath.<br>\r\nIf you maintain these simple points, keeping hydrated won’t be a difficulty. Make sure to intake watery fruits like watermelons and lots of vegetables. Sodium in these foods helps in holding fluids for a longer time. You can also sip on an electrolyte beverage like Gatorade or Glucon-D. Doctors also suggest having a protein-rich meal after a long ride. Protein carries water with it to the muscles.</p>\r\n\r\n<p><strong>Nutrition</strong><br>\r\nHuman beings require on average 2 litres of water supply to stay hydrated. This enables our body to carry on its vital processes with ease. While riding in the heat, we sweat a lot and our body fluids evaporate out into the dry air.<br>\r\nMaintaining a well-nourished diet is crucial to your summer riding needs. Along with frequent water intake, we can add plenty of watery fruits and vegetables in our diet. They are rich in vitamins and minerals which we lose during workouts.<br>\r\n1. Celery: These green and crunchy delicacies are absolutely essential. Celeries are high in fibre and low in calories. They have high water content and make a delicious snack.<br>\r\n2. Grains: Oats and rice absorb a lot of water while they are being cooked. This absorbed water gets released into our systems after we consume them and digestion begins.<br>\r\n3. Apples: Not only do they keep doctors away but also dehydration. Apples have almost 84% of water content. They make great snacks and desserts.<br>\r\n4. Cucumber: Apart from benefitting your face-mask, the water content in cucumbers also curb dehydration.<br>\r\n5. Peppers: They have high water content and taste delicious when cooked and eaten raw.<br>\r\n6. Berries: With approximately 92% water content, berries are a blessing in the summer heat. They also reduce inflammations.<br>\r\n7. Lettuce: Leafy vegetables have increased roughage and are great for hydration. Lettuces have over 96% water content.<br>\r\n8. Ice-lollies: They can be made easily at home and are refreshing. You can add cucumber peels as a base for extra hydration.<br>\r\n9. Watermelons: They speak for summers. With over 90% of water content, melons are refreshing and replenish glycogen content in our body.<br>\r\n10. Soup: Soups have a high sodium level which holds bodily fluids together.<br>\r\nIf you keep these little points in mind, travelling with your bicycle in the summers will be as easy as a breeze. For an amazing cycling experience, visit us at Beetle Bikes today!</p>', '2021-06-05', 'Hydration_&_Nutrition_for_cycling_in_summers', 'Beetle Bikes', 'uploads/blog/hydration-and-nutrition-while-riding-in-summers.jpg', 1, 0, '2021-10-27 08:33:44', NULL),
(12, 1, 'Winter Weather Cycling - Tips to Stay Warm', '<p>Cycling outdoors during the winters has its own beauty, and the adrenaline rush it gives you is immense. However, the cold weather can prove to be a big hurdle for cycling. To overcome this hurdle and make cycling an enjoyable experience during winters, here are some tips to keep warm.</p>\r\n\r\n<p><strong>Layers of Clothing</strong><br>\r\nInstead of opting for a thick jacket or sweatshirt, go for three-layer clothing or even four. Wearing clothes in layers helps your body adjust with the changing temperatures. You can use this basic order of layered clothing:<br>\r\n1.    First layer: The first or base layer should be the one which soaks the moisture and keeps your body dry<br>\r\n2.    Second layer: The second or mid-layer should be a bit thick which keeps you warm and retains the heat<br>\r\n3.    Third layer: The third or outer layer should have the properties of a wind-stopper to resist the cold airwaves</p>\r\n\r\n<p><strong>Cover Your Head</strong><br>\r\nIt is very important to cover your head and neck properly as these areas are quite sensitive to external temperatures. Layering is recommended for covering your head also. You can use a cycling cap that resists the cold waves. Make sure to top it with a cycle helmet, preferably aero-helmet, which has fewer openings to retain the heat properly.</p>\r\n\r\n<p><strong>Spare Jacket</strong><br>\r\nEven if you have covered your body with three to four layers of clothing, it is always advisable to carry a spare jacket or sweatshirt in case of a mishap. You cannot determine what may happen out there, and in case your topmost clothing gets damp or wet, a spare one can turn out to be a day-saver.</p>\r\n\r\n<p><strong>Base Layer</strong><br>\r\nEven if you are on a tight budget, ensure that you at least invest in a good quality base layer. It should soak away the moisture and keep your body dry during the cycling period. Moisture can get to your body easily and make you sick. It is important to find a base layer with technology that wicks away the moisture, has a high collar, and fits you perfectly.</p>\r\n\r\n<p><strong>Mid-Break </strong><br>\r\nIf you are planning for a long journey, for about more than three to four hours, then you should consider taking a break in between. Get something hot to drink or treat yourself to a light snack. It will warm up your body and replenish you for the journey ahead.</p>\r\n\r\n<p><strong>Cover Your Hands and Feet </strong><br>\r\nIt is advisable to cover your feet well because they can get really chilly in the wind. Instead of using layers of socks, use a comfortable and warm shoe with a shoe-jacket to stop the cold wind from creeping in. Use bicycle gloves while riding in winters. They can provide grip while giving protection from the cold.</p>\r\n\r\n<p><strong>Protect Your Eyes </strong><br>\r\nJust like the other body parts need protection from the chilly weather out there, it is equally important for your eyes to stay protected. It can get really hard for cyclists to keep their eyes open while riding at good speeds with chilly winds getting straight in their eyes. You can choose to wear sunglasses to keep your eyes well shielded or even better, opt for cycling glasses, which have an option for a clear lens when there isn’t enough visibility on the road.</p>\r\n\r\n<p><strong>Carry Warm Water</strong><br>\r\nCold water or even water kept at room temperature is a strict no during winters. It is advisable to carry warm liquid in an insulated bike water bottle. You can also carry tea mixed with apples and cinnamon to stay hydrated during the journey.</p>\r\n\r\n<p><strong>Eat Well</strong><br>\r\nDo eat well before going out for the ride. Having a proper meal will ensure that you do not fall short of energy required for the journey, given that the body requires more energy for a workout during winters. The food will also help you to stay warm during the ride. Don’t forget to pack something light for the trip as well.</p>\r\n\r\n<p><strong>Do High-Intensity Cycling</strong><br>\r\nIt is better to exert yourself more than the usual during winters, so that your body heats up quickly and the cold weather becomes bearable. Cycling with extra force will also make you tired faster, shortening your trip and ensuring that you do not stay out there in the cold for a long time.</p>\r\n\r\n<p><strong>Install Mudguards</strong><br>\r\nMake sure to install bicycle mudguards if you do not have them or put them back on if you have removed them. Bicycle mudguards will protect your body from the mud that splashes around while cycling. This is important so that the mud doesn’t make your body wet and lets you stay dry.</p>\r\n\r\n<p>Cycling during the winters has its own kind of enjoyment. Make sure that you do not miss out on the fun by taking proper measures and buying the required bicycle parts. For the best bicycle accessories India at reasonable rates, visit Beetle Bikes today. </p>', '2021-10-26', 'Winter_Weather_Cycling_Tips_to_Stay_Warm', 'Beetle Bikes', 'uploads/blog/winter-weather-cycling---tips-to-stay-warm.jpg', 1, 0, '2021-10-27 08:35:01', NULL),
(13, 1, 'This Children’s Day Gift your Kid a Cycle', '<p>Remember those times when you spent hours riding a bicycle as a kid, chatting with friends and enjoying those glorious days of childhood? So there’s no reason your kids shouldn’t experience the joys of childhood. <br>\r\nToday, kids are fast falling victims to the onslaught of technology, rarely ever stepping out to have some good old fun. This makes cycling an even more important activity to cultivate in their lives, allowing them to have fun in a healthy way. And what better occasion than Children’s Day to gift your child the love of cycling for a healthier life! </p>\r\n\r\n<p><strong>Good Exercise for Children</strong><br>\r\nMillions of children in India today are victims of obesity. Promoting a habit of cycling every day can play an instrumental role in bringing this number down and encouraging good health in our kids. Cycling for just an hour every day burns more calories than walking or running. </p>\r\n\r\n<p><strong>Stress Buster</strong><br>\r\nChildren can often feel overwhelmed by schoolwork, bogged down by heavy books, tuitions, and homework. Bicycling provides an escape into a world where they can play with friends, be themselves, and have fun. This can help break the monotony of daily life and can provide hours of enjoyment every day.</p>\r\n\r\n<p><strong>Increases Sociability </strong><br>\r\nWho doesn’t remember the endless hours spent cycling with buddies from childhood? It is a good way of bonding with friends and create memories for a lifetime. Buying your children a bicycle will allow them to experience this fun. Developing social skills is an important part of childhood and playing with friends helps in that growth.</p>\r\n\r\n<p><strong>Induces Active Behaviour</strong><br>\r\nA big complaint of parents is that kids these days spend too much time in the virtual world. Gifting your kid a cycle will get them out of the house and induce in them, a more curious and thoughtful nature. The world is full of adventures that their unshaped minds can benefit from and bicycling every day is the perfect opportunity to uncover such adventures.</p>\r\n\r\n<p><strong>A Sense of Ownership and Responsibility </strong><br>\r\nA cycle is one of the first things that a child calls truly his own. Allow your child to play an active role in choosing a cycle to their liking – a road bike, a mountain bike, BMX bike or a hybrid bike. It gives them a sense of ownership and to an extent, fills them with pride. Kids learn to responsible owners and how to take care of their things. They learn to maintain different parts of it - brakes, chain, or helmet, etc.  </p>\r\n\r\n<p>There are other benefits of daily cycling too. Children become more cautious on the roads. They develop better balance and coordination and most importantly, they learn to dust themselves off and get back on their feet after a fall, which is an important lesson in life.</p>\r\n\r\n<p>Beetle Bikes is a one-stop shop for most of your bicycle needs. With a wide range of bicycle and related accessories, it is the best online store for a parent wishing to enrich their child’s life. We aim to provide convenience, quality and range in our services and products, to encourage more children to start cycling.</p>\r\n\r\n<p>Riding a bicycle is truly a unique experience and there is no substitute for it. The feeling of the cold wind blowing in your face as you zoom past on a sharp curve is indescribable and it is one of the purest of childhood memories that your child could carry with them for the rest of their life. So, what are you waiting for?</p>\r\n\r\n<p>Bring home a bicycle today and gift your child with a healthier, happier future. </p>', '2020-11-14', 'This_Childrens_Day_Gift_your_Kid_a_Cycle', 'Beetle Bikes', 'uploads/blog/common-posture-mistakes-we-make-while-cycling.jpg', 1, 0, '2021-10-27 08:37:21', '2021-10-27 21:08:41');
