(1, NULL, 'Admin Forgot Password', 'Dhofar Global |  Forgot Password', '<div style=\"width: 650px; margin:auto;\">&nbsp;\r\n	<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 650px; margin:auto; border: 1px solid #CECECE;\" width=\"650px\">\r\n		<tbody>\r\n			<tr height=\"80\" valign=\"top\">\r\n				<td height=\"80\" style=\"border-bottom:solid 2px #3E3E3E\">\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr style=\"height: 60px;\">\r\n												<td style=\"padding-top: 10px; padding-bottom: 5px; padding-left:5px;\"><img style=\"opacity: 1.8;padding:20px\" alt=\"%%project_name%%\" border=\"0\" src=\"%%site_url%%%%site_logo%%\" /></td>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;padding:10px;width: 400px;text-align:right\"><b>%%date%%</b><br />\r\n							<br />\r\n							<b>Forgot Password</b></td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"padding-left:20px;padding-right:20px;padding-bottom:20px;padding-top:20px\">\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;\">Hello %%username%%,</td>\r\n						</tr>\r\n						<tr>\r\n							<td height=\"5\">&nbsp;</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;\">Your Account Password Reset Request !</td>\r\n						</tr>\r\n											<tr>\r\n							<td height=\"5\">&nbsp;</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;\">\r\n							<p>We received a request to reset the password associated with this e-mail address. If you made this request, please follow the instructions below.</p>\r\n	\r\n							<p>Click on the link below to reset your password now<br />\r\n							<br />\r\n							<a href=\"%%uid%%\">%%uid%%</a></p>\r\n	\r\n							<p>If you did not request to have your password reset you can safely ignore this email. Rest assured that your account is safe.</p>\r\n	\r\n							<p>If clicking the link does not work, you can copy and paste the link into your browser window, or retype it. Once you have returned to %%project_name%% Application, we will give you instructions for resetting your password.</p>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding-left: 20px;padding-bottom: 15px;font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;line-height:16px;\">Regards,<br />\r\n							Dhofar Global Team</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td bgcolor=\"#3E3E3E\" style=\"height: 25px;\">&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-align:center;padding-top: 10px; padding-bottom: 10px;\"><b>%%copyright%%</b></td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	', 1, 1, '2017-02-26 21:45:26', 1, '2018-02-16 12:03:00'),
(5, NULL, 'Contact Us Enquiry', 'Dhofar Global | Contact-Us Enquiry', '<div style=\"width: 650px; margin:auto;\">\r\n	&nbsp;\r\n	<table align=\"center\" width=\"650px\" cellspacing=\"0\" cellpadding=\"0\" style=\"width: 650px; margin:auto; border: 1px solid #CECECE;\">\r\n		<tbody>\r\n			<tr height=\"80\" valign=\"top\">\r\n				<td height=\"80\" style=\"border-bottom:solid 2px #3E3E3E\">\r\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n					<tbody>\r\n						<tr style=\"height: 60px;\">\r\n												<td style=\"padding-top: 10px; padding-bottom: 5px; padding-left:5px;\"><img style=\"opacity: 1.8;padding:20px;\" alt=\"front-logo\" border=\"0\" src=\"%%site_url%%%%site_logo%%\" /></td>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;padding:10px;width: 400px;text-align:right\"><b>%%date%%</b><br />\r\n							<br />\r\n							<b>Contact-Us Enquiry Received</b></td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"padding-left:20px;padding-right:20px;padding-bottom:20px;padding-top:20px\">\r\n				<table border=\"1\" cellpadding=\"5\" cellspacing=\"5\" class=\"table table-bordered tableformat\" style=\"border-collapse:collapse;border-color:#d7d7d7;border: 1px solid #d7d7d7;\" width=\"100%\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;line-height:16px;width:30%\"><b>Name:</b></td>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;line-height:16px;width:70%\">%%name%%</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#292929;text-decoration:none;line-height:16px;width:30%\"><b>Email:</b></td>\r\n							<td style=\"font-family:Tahoma, Arial, Helvetica, sans-serif;font-size:12px;color:#2