(6, NULL, 'Admin Newsletter', 'Newsletter', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<div style=\"width: 900px; margin:auto; border: 1px solid #CECECE;\">\r\n<div style=\"font-family:\"Brandon\",Helvetica,Arial!important;font-size:16px;color:#30373b;background-color:#fff; margin: 25px;\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr height=\"80\" valign=\"top\">\r\n			<td height=\"80\">\r\n			<table border=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"%%project_name%%\" border=\"0\" src=\"%%site_url%%%%site_logo%%\" style=\"padding-bottom: 10px\" /></td>\r\n					</tr>\r\n					<tr>\r\n						<td bgcolor=\"#0d706d\" style=\"text-align:right;font-family:Verdana;font-size:18px;color:#fff;text-decoration:none;text-indent:10px;height: 25px;\"><b>%%project_name%% Newsletter</b>&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding:20px;\">%%description%%</td>\r\n		</tr>\r\n		<tr>\r\n			<td bgcolor=\"#0d706d\" style=\"height: 25px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"20\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center;\">%%copyright%%</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n', 1, 0, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00'),
