(1, NULL, 'Home', 'Vinita Michael', '', '', 0, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Vinita Michael Celeb Style Trending &amp; Fashionable Jewellery', '', 'Browse the stunning range of Vinita Michael celebrity style trending and fashionable men and women jewellery online including earrings, rings, bracelets, cufflinks and many more at an exciting range of prices. Vinita Michael is an award winning jewellery designer and gemologist. Visit us now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-19 12:08:15', '0000-00-00 00:00:00'),
