(17, NULL, 'Refund Policy', 'Refund', 'uploads/page/banner-image/inner-banners.png', '<p style=\"text-align: justify;\">No refunds or returns can be claimed for any reason unless the product you purchase is damaged when it arrives. In case of damage please reach out to us with a clear picture of the damaged area and proof of receipt date within 24 hours of receipt of the merchandise. The cost of the return shipping will be borne by the customer. Upon receipt of the damaged merchandise the customer will be offered store credit equal to the value of the returned merchandise.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">We can be reached at <a href=\"mailto:vinita@vinitamichael.com\" style=\"text-decoration:none;\"><span style=\"color:#757b7e;\">vinita@vinitamichael.com</span></a> or via whatsapp at +971-50-7092290 between 8am- 5pm GST (Gulf Standard Time), Sunday to Thursday.</p>\r\n', 1, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Refund Policy', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-25 10:17:07', '0000-00-00 00:00:00'),
(18, NULL, 'Terms & Conditions', 'Terms & Conditions', 'uploads/page/banner-image/innerbanner.png', '<p style=\"text-align: justify;\"><strong>Use of the Website</strong></p>\r\n\r\n<p style=\"text-align: justify;\">By accessing the website, you warrant and represent to the website owner that you are legally entitled to do so and to make use of information made available via the website.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Trademarks</strong></p>\r\n\r\n<p style=\"text-align: justify;\">The trademarks, names, logos and service marks (collectively &ldquo;trademarks&rdquo;) displayed on this website are registered and unregistered trademarks of the website owner. Nothing contained on this website should be construed as granting any license or right to use any trademark without the prior written permission of the website owner.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>External links</strong></p>\r\n\r\n<p style=\"text-align: justify;\">External links may be provided for your convenience, but they are beyond the control of the website owner and no representation is made as to their content. Use or reliance on any external links and the content thereon provided is at your own risk.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Warranties</strong></p>\r\n\r\n<p style=\"text-align: justify;\">The website owner makes no warranties, representations, statements or guarantees (whether express, implied in law or residual) regarding the website.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Prices</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Our pricing is calculated using current precious metal and gem prices to give you the best possible value. These prices do change from time to time, owing to the fluctuations in prices of precious metal and gem prices, so our prices change as well. Prices on vinitamichael.com are subject to change without notice. Please expect to be charged the price for the vinitamichael.com merchandise you buy as it is listed on the day of purchase.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Disclaimer of liability</strong></p>\r\n\r\n<p style=\"text-align: justify;\">The website owner shall not be responsible for and disclaims all liability for any loss, liability, damage (whether direct, indirect or consequential), personal injury or expense of any nature whatsoever which may be suffered by you or any third party (including your company), as a result of or which may be attributable, directly or indirectly, to your access and use of the website, any information contained on the website, your or your company&rsquo;s personal information or material and information transmitted over our system. In particular, neither the website owner nor any third party or data or content provider shall be liable in any way to you or to any other person, firm or corporation whatsoever for any loss, liability, damage (whether direct or consequential), personal injury or expense of any nature whatsoever arising from any delays, inaccuracies, errors in, or omission of any share price information or the transmission thereof, or for any actions taken in reliance thereon or occasioned thereby or by reason of non-performance or interruption, or termination thereof. We as a merchant shall be under no liability whatsoever in respect of any loss or damage arising directly or indirectly out of the decline of authorization for any Transaction, on Account of the Cardholder having exceeded the preset limit mutually agreed by us with our acquiring bank from time to time.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Conflict of terms</strong></p>\r\n\r\n<p style=\"text-align: justify;\">If there is a conflict or contradiction between the provisions of these website terms and conditions and any other relevant terms and conditions, policies or notices, the other relevant terms and conditions, policies or notices which relate specifically to a particular section or module of the website shall prevail in respect of your use of the relevant section or module of the website.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Severability</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Any provision of any relevant terms and conditions, policies and notices, which is or&nbsp;becomes unenforceable in any jurisdiction, whether due to being void, invalidity, illegality, unlawfulness or for any reason whatever, shall, in such jurisdiction only and only to the extent that it is so unenforceable, be treated as void and the remaining provisions of any relevant terms and conditions, policies and notices shall remain in full force and effect.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Applicable laws (choice of venue and forum)</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Use of this website shall in all respects be governed by the laws of the UAE, regardless of the laws that might be applicable under principles of conflicts of law. The parties agree that the courts located in UAE, shall have exclusive jurisdiction over all controversies arising under this agreement and agree that venue is proper in those courts.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Shipping</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Vinita Michael provides free delivery/shipping on all items within UAE for international shipping the fees will be calculated during the checkout process. Fulfillment time is 24-48hrs for &ldquo;Available in Stock&rdquo; items and 10 business days for &ldquo;Make to Order&rdquo; items.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Customs &amp; Duties</strong></p>\r\n\r\n<p style=\"text-align: justify;\">For orders that is being shipped outside of the United Arab Emirates, the customer may be subject to import taxes, customs duties and fees levied by the destination country. The customer must assume additional charges for customs clearance, vinitamichael.com has no control over these charges and cannot predict what they may total.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Returns</strong></p>\r\n\r\n<p style=\"text-align: justify;\">PolicyNo refunds or returns can be claimed for any reason unless the product you purchase is damaged when it arrives. In case of damage please reach out to us with a clear picture&nbsp;of the damaged area and proof of receipt date within 24 hours of receipt of the merchandise. The cost of the return shipping will be borne by the customer. Upon receipt of the damaged merchandise the customer will be offered store credit equal to the value of the returned merchandise.</p>\r\n\r\n<p style=\"text-align: justify;\">We can be reached at vinita@vinitamichael.com or at +971-50-7092290 between 8am- 5pm GST (Gulf Standard Time), Sunday to Thursday.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Physical Address:</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Vinita Michael FZE, Creative City, P.O. Box 4422, Fujairah, UAE</p>\r\n', 1, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Terms & Conditions | Vinita Michael', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-30 04:12:17', '0000-00-00 00:00:00'),
