(32, NULL, 'Celeb Style', 'CELEBRITIES SPOTTED WEARING VINITA MICHAEL', 'uploads/page/banner-image/celeb_bg.png', '<p>Bold and edgy, our designs are sported by A-list celebrities and fashion influencers worldwide. Get inspired and shop our &#39;Celeb Style&#39; picks here !</p>\r\n', 1, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Celebrity  – Vinita Michael', '', 'CELEBRITIES SPOTTED WEARING VINITA MICHAEL Bold and edgy, our designs are sported by A-list celebrities and fashion influencers worldwide. Get inspired and shop our \'Celeb Style\' picks here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-26 09:19:34', '0000-00-00 00:00:00'),
(34, NULL, 'Designer Profile', 'Vinita Michael', 'uploads/page/banner-image/designer.png', '<p>Award winning jewelry designer and gemologist, Vinita&rsquo;s eponymous label strives to bring together the magnificence of unique design conceptualizations and intricate craftsmanship, in the form of jewelry and precious lifestyle products. Filigree, Repousse&#39;, Chasing, Engraving and Etching are some of the many rich metal crafts of the Indian Subcontinent that have encouraged her to experiment with the limitless possibilities in exploring the metallic surface.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Today, Vinita specializes in both Fine Gold set with precious gems and Sterling Silver jewelry. Her pieces have adorned Bollywood celebrities such as<span style=\"color:null;\"><strong> </strong>Priyanka Chopra, Sonam Kapoor, Deepika Padukone and Jacqueline Fernandez</span>, to name a few.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Besides developing collections for her own line, Vinita also works on special commissioned projects for international fashion and jewelry brands such as Swarovski TRESemm&eacute; Arabia, Bluestone, Monsieur Fox, Al Mahmood Pearls, Amrapali Jewels, Anmol Jewellers, World Gold Council and Mikura Pearls, to name a few.</p>\r\n', 1, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'The designer  – Vinita Michael', '', 'Vinita Michael Award winning jewelry designer and gemologist, Vinita\'s eponymous label strives to bring together the magnificence of unique design conceptualizations and intricate craftsmanship, in the form of jewelry and precious lifestyle products. Filigree, Repousse\', Chasing, Engraving and Etching are some of the m', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-26 10:20:49', '0000-00-00 00:00:00'),
(35, NULL, 'Personalized', 'Personalized', 'uploads/page/banner-image/banners-contact.png', '', 0, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Personalized | Vinita Michael', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-30 04:13:09', '0000-00-00 00:00:00'),
(36, NULL, 'Shipping & Delivery', 'Shipping & Delivery', 'uploads/page/banner-image/innerbanner.png', '<p style=\"text-align: justify;\"><strong>Shipping</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Vinita Michael provides free delivery/shipping on all items within UAE. For international shipping, the fees will be calculated during the checkout process. Fulfillment time is 24-48hrs for &ldquo;Available in Stock&rdquo; items and 7-10 business days for &ldquo;Make to Order&rdquo; items.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Customs &amp; Duties</strong></p>\r\n\r\n<p style=\"text-align: justify;\">For orders that are being shipped outside of the United Arab Emirates, the customer may be subject to import taxes, customs duties and fees levied by the destination country. The customer must assume additional charges for customs clearance, vinitamichael.com has no control over these charges and cannot predict what they may total.</p>\r\n', 1, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Shipping & Delivery | Vinita Michael', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', 1, '2021-03-30 04:12:41', '0000-00-00 00:00:00');
