INSERT INTO `product` (`id`, `admin_id`, `product_name`, `slug`, `category_level_1`, `category_level_2`, `description`, `specifications`, `sku_code`, `hsn_code`, `dimension`, `net_weight`, `deno`, `stock`, `mrp`, `selling_price`, `gst`, `attributes`, `available_date`, `available_time`, `image_path`, `label`, `meta_title`, `meta_key_words`, `meta_description`, `is_active`, `featured`, `display_on_home`, `on_sale`, `display_order`, `created_at`, `updated_at`, `wheel_size`, `frame_size`, `frame_material`, `tyre_type`, `handle_type`, `break_type`, `age_range`) VALUES
(1, 1, 'Beetle Vintage 20T Kids\' Bike', 'beetle-vintage-20t-kids-bike', 1, 0, '<h3><span xss=\"removed\"><strong>Retro Design that Stands out from the Crowd!</strong></span></h3>\r\n\r\n<ul>\r\n <li><span xss=\"removed\"><span xss=\"removed\">The cycle is delivered in Semi-Assembled condition (85% assembled). Customer needs to assemble it before use. Allen Key & Spanner provided in box for installation.</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">Wheel size: 20 inches | Tyres: Colour Coordinated</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">Ideal For: 6-10 Years | Boys & Girls| Min Rider Height: 3.5 feet | Max Rider Height: 4.5 feet</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">Front Brake: V-Brakes | Rear Brake: V-Brakes</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">Gears: Single Speed</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">Frame Material: Steel | Suspension: NA | Side Stand: Included</span></span></li>\r\n <li><span xss=\"removed\"><span xss=\"removed\">In Box Content: Allen Key & Spanner: Yes| Stand: Yes| Carrier: Yes| Front Reflectors/Rear Reflectors : Yes| Chain Cover: Yes| Bell: Yes</span></span></li>\r\n</ul>', '<p><strong>Introducing Beetle Vintage, a Bike that perfectly mixes style and substance!</strong></p>\r\n\r\n<p>This durable and dependable bike is engineered from strong and lightweight steel and is equipped with superb components to ensure every cycling venture is efficient and comfortable.</p>\r\n\r\n<p>The Beetle Vintage brings back style from a bygone era. Deep Red/Maroon frame that will make the youngster stand out from the crowd! A rear carrier with full rear mudguard, large graphics on the chain guard further add to the overall style quotient of the bike. The vintage look is completed by a saddle and handlebar that remind of an era gone by.</p>\r\n\r\n<p>With high end components, the Beetle Vintage will ensure a safe and smooth ride for you child. With high quality MIG welding on the frame, you can be sure that this bike will take all obstacles in its stride. The smoothness is further made better with 2.1 inch tyres.</p>\r\n\r\n<p>Saddle height is adjustable and can be raised or lowered as per the rider height. High quality, slip resistant pedals ensure that the rider enjoys cycling in a safe manner.</p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Highlights:</strong></p>\r\n\r\n<ul>\r\n <li>Strong & lightweight Steel Frame</li>\r\n <li>Bold design that stands out from the crowd</li>\r\n <li>Adjustable Seat height</li>\r\n <li>High quality Transmission</li>\r\n <li>Durability & Stability with a well designed frame stance</li>\r\n <li>Single speed bike makes maintenance much easier</li>\r\n <li>Built to last. 18 month unlimited warranty on frame</li>\r\n <li>Huge on Style!</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Why you&#39;ll fall in love with Beetle Bikes</strong><br>\r\n• Beetle is an Only-Kids brand! European Quality, made with passion and love in India.<br>\r\n• A simple bike, single speed makes it easier at this age. This is all you need to have all the fun and fitness.<br>\r\n• Higher handlebar makes it a comfortable ride.<br>\r\n• V-brakes are easy to maintain and provide a safe ride.<br>\r\n• Beetle Storm, one of its kind styling and colour that you can get in India.<br>\r\n• The bike is built to last, so younger siblings can inherit this bike and it&#39;ll still feel like new.<br>\r\n• Frame warranty of 18 months.<br>\r\n• Lastly, and importantly, they are very stylish to make kids feel awesome while riding.</p>', 'FG-EVC20RED', '87120010', '25', '14.200', 2, 200, '9499.00', '6499.00', NULL, NULL, '2021-09-25', NULL, 'uploads/product/1_1.png', NULL, 'Beetle Vintage Kids Cycle 20T', 'Kids Cycle, 20T Cycle, Beetle Bikes, Beetle Cycle, Beetle Vintage', '', 1, 1, 1, 0, 1, '2021-09-24 10:19:03', '2021-11-01 19:24:49', '20T', 'Kids', 'Steel', 'Rubber Tyre with tube', 'High handlebar', 'V-Brakes', NULL),
